export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "제로초",
      },
      content: "첫 번째 게시글 #해시태그 #익스프레스",
      Images: [
        {
          src: "data:image/jpeg;base64,",
        },
        {
          src: "data:image/jpeg;base64,",
        },
        {
          src: "data:image/jpeg;base64,",
        },
      ],
      Comments: [
        {
          User: {
            nickname: "nero",
          },
          content: "우와 개정판이 나왔군요",
        },
        {
          User: {
            nickname: "hero",
          },
          content: "얼른 사고 싶어요",
        },
      ],
    },
  ],
  imagePaths: [],
  postAdded: false,
};

const reducers = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducers;
